CREATE TABLE public.persona (
    id SERIAL PRIMARY KEY,
    numero_documento VARCHAR NOT NULL,
    id_tipo_documento BIGINT NULL,
    nombre_completo VARCHAR NULL,
    id_sexo BIGINT NULL,
    fecha_nacimiento DATE NULL,
    CONSTRAINT persona_sexo_fk FOREIGN KEY (id_sexo) REFERENCES public.sexo(id),
    CONSTRAINT persona_tipo_documento_fk FOREIGN KEY (id_tipo_documento) REFERENCES public.tipo_documento(id)
);

CREATE TABLE public.empleado (
    id_user UUID DEFAULT gen_random_uuid() NOT NULL PRIMARY KEY,
    id_persona INTEGER NOT NULL,
    user_name VARCHAR NOT NULL,
    estado_cuenta VARCHAR DEFAULT 'Activo',
    correo_electronico VARCHAR NOT NUll UNIQUE,
    rol VARCHAR,
    CONSTRAINT empleado_persona_fk FOREIGN KEY (id_persona) REFERENCES public.persona(id) ON DELETE CASCADE
);

CREATE TABLE public."Pedido" (
    id SERIAL4 NOT NULL PRIMARY KEY,
    created_at TIMESTAMP WITH TIME ZONE DEFAULT now() NOT NULL,
    cliente TEXT DEFAULT ''::TEXT,
    fecha_pagado TIMESTAMP WITH TIME ZONE,
    "tiempoPreparacion" TEXT DEFAULT ''::TEXT,
    mesero TEXT DEFAULT ''::TEXT,
    "paraLlevar" BOOLEAN,
    id_mesa BIGINT,
    identificador_manual TEXT DEFAULT ''::TEXT,
    "precioTotal" BIGINT,
    id_mesero UUID,
    estado TEXT,
    string_pedido TEXT,
    CONSTRAINT pedido_mesa_fk FOREIGN KEY (id_mesa) REFERENCES public."Mesa"(id),
    CONSTRAINT pedido_mesero_fk FOREIGN KEY (id_mesero) REFERENCES public."empleado"(id_user)
);

